import React from "react";

import Header from "../Header/Header";
// import Home from "../Home/Home"
import Hero from "../Home/Hero/Hero";
// import Hero from "./Hero/Hero";
// import Intro from "./Intro/Intro";
import Footer from "./Footer/Footer";
import Home from "../Home/Home";
import logo from "../../img/logo.png";
import {BrowserRouter as Router, NavLink, Route, Switch} from "react-router-dom";
import {LinkingWrapper} from "../Header/Header.styles";

const App = () => {
    return (
        <div>
            <div className="navbar" id="navbar">
                <img className="logo" src={logo} alt="Logo" height={40} width={40} />
                <div className="nav_menu">
                    <Router>
                        <LinkingWrapper>
                            <ul>
                                <li>
                                    <NavLink exact to="/" activeClassName="selected">Home</NavLink>
                                </li>
                                <li>
                                    <NavLink exact to="/shop" activeClassName="selected">Shop</NavLink>
                                </li>
                                <li>
                                    <NavLink exact to="/blog" activeClassName="selected">Blog</NavLink>
                                </li>
                                <li>
                                    <NavLink exact to="/contact" activeClassName="selected">Contact</NavLink>
                                </li>
                            </ul>
                            <Switch>
                                <Route path="/shop">
                                    <div>:(</div>
                                </Route>
                                <Route path="/blog">
                                    <div>:(</div>
                                </Route>
                                <Route path="/contact">
                                    <div>:(</div>
                                </Route>
                                <Route exact path="/" component = {Home}>
                                    <Home />
                                </Route>
                            </Switch>
                        </LinkingWrapper>
                    </Router>

                </div>
            </div>
            <div className="underline"></div>
        </div>
    );
};

export default App;
